18.body:
glyphnames.json maps code points to canonical glyph names, which by convention use lower camel case, a convenient format for most programming languages. Here is an excerpt of this file: {
... "barlineDashed": { "alternateCodepoint": "U+1D104", "codepoint": "U+E036", "description": "Dashed barline" }, "barlineDotted": { "codepoint": "U+E037" "description": "Dotted barline" }, "barlineDouble": { "alternateCodepoint": "U+1D101", "codepoint": "U+E031" "description": "Double barline" }, "barlineFinal": { "alternateCodepoint": "U+1D102", "codepoint": "U+E032" "description": "Final barline" }, "barlineHeavy": { "codepoint": "U+E034" "description": "Heavy barline" },
...
} The file is keyed using the glyph names, with the SMuFL code point provided as the value for the "codepoint" key, and the Unicode Musical Symbols range code point (if applicable) provided as the value for the "alternateCodepoint" key. The "description" key contains the glyph’s description, as it appears in this specification.

19.body:
classes.json groups glyphs together into classes, so that software developers can handle similar glyphs (e.g. noteheads, clefs, flags, etc.) in a similar fashion. Here is an excerpt of this file: {
... "clefs": [ "gClef", "gClef15mb", "gClef8vb", "gClef8va", "gClef15ma", "gClef8vbOld", "gClef8vbCclef", ... ], "noteheads": [ "noteheadDoubleWhole", "noteheadWhole", "noteheadHalf", "noteheadBlack", "noteheadNull", ... ], "flags": [ "flag8thUp", "flag8thDown", "flag16thUp", "flag16thDown", "flag32ndUp", "flag32ndDown", ... ],
...
} Glyphs are listed within their classes using the names specified in glyphnames.json. Not all glyphs are contained within classes, and the same glyph can appear in multiple classes. The classes defined at present are as follows: Class name Description accidentals Contains all glyphs in all accidentals ranges. accidentals24EDOArrows, accidentals53EDOTurkish, accidentals72EDOWyschnegradsky, accidentalsAEU, accidentalsArabic, accidentalsHelmholtzEllis, accidentalsJohnston, accidentalsPersian, accidentalsSagittalAthenian, accidentalsSagittalDiacritics, accidentalsSagittalMixed, accidentalsSagittalPromethean, accidentalsSagittalPure, accidentalsSagittalTrojan, accidentalsSims, accidentalsStandard, accidentalsSteinZimmermann, accidentalsStockhausen These classes contain useful subsets of accidentals, each class essentially providing all of the accidentals glyphs required for a given convention or system. articulations Contains all articulations, regardless of whether they are intended to be positioned above or below the note/staff. articulationsAbove, articulationsBelow Contains only those articulations that are positioned either above or below the note/staff, as appropriate. combiningStaffPositions Contains glyphs that are available in ligatures with the Combining staff position glyphs, in fonts intended for use in text-based applications. (N.B. not implemented in the current Bravura font, which is intended for scoring applications.) clefs Contains all clefs, regardless of the position on the staff at which they are typically positioned. clefsC Contains all C clefs. clefsF Contains all F clefs. clefsG Contains all G clefs. dynamics Contains the glyphs in the Dynamics range, which should be scaled differently to other glyphs in fonts designed for use in text-based applications. forTextBasedApplications Contains glyphs that scoring applications can generally ignore, i.e. these are useful for text-based applications (or for runs of normal text in scoring applications). This contains glyphs like the Beamed groups of notes range, pre-composed stems, pre-composed staff lines, etc. multiGlyphForms Contains all glyphs that are designed to be used in combination to produce larger forms, e.g. ornaments, wiggly lines, etc. noteheads Contains all glyphs in all noteheads ranges. noteheadSetCircled, noteheadSetCircleX, noteheadSetDefault, noteheadSetDiamond, noteheadSetDiamondOld, noteheadSetHeavyX, noteheadSetLargeArrowDown, noteheadSetLargeArrowUp, noteheadSetNamesPitch, noteheadSetNamesSolfege, noteheadSetPlus, noteheadSetRoundLarge, noteheadSetRoundSmall, noteheadSetSacredHarp, noteheadSetSlashed1, noteheadSetSlashed2, noteheadSetSlashHorizontalEnds, noteheadSetSlashVerticalEnds, noteheadSetSquare, noteheadSetTriangleDown, noteheadSetTriangleLeft, noteheadSetTriangleRight, noteheadSetTriangleUp, noteheadSetWithX, noteheadSetX, parenthesesNotehead These classes contain useful subsets of noteheads, each class providing a set of noteheads, e.g. the notehead to be used for quarter notes and shorter, for half notes, for whole notes, etc., for different conventions. octaves Contains all glyphs relating to octave lines. ornaments Contains all pre-composed ornament glyphs, excluding the component parts in the Combining strokes for trills and mordents range. pauses Contains all fermatas/caesuras, regardless of whether they are intended to be positioned above or below the note/staff. pausesAbove, pausesBelow Contains only those fermatas that are positioned either above or below the note/staff, as appropriate. rests Contains all rests glyphs. stemDecorations Contains glyphs that are designed to be positioned on stems. This is a useful class, because the individual glyphs that are intended to be drawn on stems are dotted around various ranges. wigglesArpeggiato, wigglesArpeggiatoDown, wigglesArpeggiatoUp, wigglesCircularMotion, wigglesQuasiRandom, wigglesTrill, wigglesVibrato, wigglesVibratoVariable These classes contain useful subsets of the Multi-segment lines range.

25.body:
The optional "glyphAdvanceWidths" structure describes the advance width of each glyph. The advance width is defined as the width of a glyph as measured from its origin to the origin of the next glyph on the line. In text fonts for many languages, glyphs normally have positive left and right side-bearings, i.e. space to either side of the glyph, so that a string of glyphs will show the expected letter spacing. The advance width includes these side-bearing values. If a glyph's path protrudes beyond the width defined for the glyph in the font, however, these protrusions to the left or the right – which can be termed negative side-bearings – are not included in the advance width. In SMuFL fonts, glyphs typically have zero left and right side-bearings, and some glyphs may have negative side-bearings. For example, stemSulPonticello has a very narrow width, and large negative side-bearings to accommodate the sul ponticello sign that is centered on the stem. Values in the "glyphAdvanceWidths" structure are expressed as a single value in staff spaces, to any required degree of precision. Below is an excerpt from a dummy font metadata file for Bravura, with a section of the "glyphAdvanceWidths" structure filled in: {
... "glyphAdvanceWidths": { "analyticsNebenstimme": 2.836, "figbass9": 0.944, "pictBeaterSoftBassDrumDown": 1.28, "wiggleCircularEnd": 0.648, ... }
} For each glyph, the "glyphAdvanceWidths" structure provides the glyph’s name and its advance width.

28.body:
The optional "glyphBBoxes" structure contains information about the actual bounding box for each glyph. [1] The glyph bounding box is defined as the smallest rectangle that encloses every part of the glyph’s path, and is described as a pair of coordinates for the bottom-left (or southwest) and top-right (or northeast) corners of the rectangle, expressed staff spaces to any required degree of precision, relative to the glyph origin. Below is an excerpt from a dummy font metadata file for Bravura, with a section of the "glyphBBoxes" structure filled in: {
... "glyphBBoxes": { "brace": { "bBoxNE": [ 0.328, 3.988 ], "bBoxSW": [ 0.008, 0.0 ] }, "braceFlat": { "bBoxNE": [ 0.36, 4.084 ], "bBoxSW": [ 0.0, 0.004 ] }, ... }
} For each glyph, the "glyphBBoxes" structure provides the glyph’s name and the coordinates of the opposite corners of the bounding rectangle (keys bBoxSW and bBoxNE). This data is provided primarily for MakeMusic Finale, which requires bounding box data for certain graphical and spacing calculations performed by the software. This information is stored in a per-font data file called a Font Annotation (FAN) file, and can be edited directly within Finale in the Font Annotation dialog. Font designers who choose to provide this information for SMuFL-compliant fonts can save end users the steps of creating Font Annotation files in Finale, as future versions of Finale may be able to consume this metadata directly and automatically produce the required Font Annotation file.

29.body:
The "ligatures" structure contains a list of ligatures defined in the font. Applications that cannot access advanced font features like OpenType ligatures can instead determine the presence of a ligature that joins together a number of recommended glyphs, and its code point, using this data. Below is an excerpt from a dummy font metadata file for Bravura, with a section of the "ligatures" structure filled in: { ... "ligatures": { "accidentalDoubleFlatParens": { "codepoint": "U+F530", "componentGlyphs": [ "accidentalParensLeft", "accidentalDoubleFlat", "accidentalParensRight" ] }, ... }
...
} The structure uses the name of the ligature as its key, and the values include its code point, and its component glyphs. The component glyphs should be listed in an array called "componentGlyphs", in the same order as they are listed in e.g. the liga OpenType table.

30.body:
The "sets" structure contains a list of stylistic sets defined in the font. Applications that cannot access advanced font features like OpenType stylistic sets can instead determine the presence of sets in a font, the purpose of each set, and the name and code point of each glyph in each set, using this data. The purpose of each set is specified by the "type" key, which can have any of the following values: Value Description "opticalVariantsSmall" Glyphs designed for use on smaller staff sizes. "flagsShort" Alternate shorter flags for notes with augmentation dots. "flagsStraight" Alternate flags that are straight rather than curved. "timeSigsLarge" Alternate time signature digits for use outside the staff. "noteheadsLarge" Alternate oversized noteheads. The current list of values for "type" are based on the sets present in Bravura. If you are a font designer and wish to add other sets to your own font, please propose a new value and description for the "type" key to the SMuFL community so that it can be discussed and subsequently added to the above list in a future revision. Below is an excerpt from a dummy font metadata file for Bravura, with a section of the "sets" structure filled in: {
... "sets": { "ss01": { "type": "opticalVariantsSmall", "description": "Smaller optical size for small staves", "glyphs": [ { "codepoint": "U+F428", "name": "accidentalFlatSmall", "alternateFor": "accidentalFlat" }, { "codepoint": "U+F429", "name": "accidentalNaturalSmall", "alternateFor": "accidentalNatural" }, { "codepoint": "U+F42A", "name": "accidentalSharpSmall", "alternateFor": "accidentalSharp" }, ... ], }, "ss02": { "type": "FlagsShort", "description": "Short flags (to avoid augmentation dots)", "glyphs": [ { "codepoint": "U+F411", "name": "flag8thUpShort", "alternateFor": "flag8thUp" }, { "codepoint": "U+F414", "name": "flag16thUpShort", "alternateFor": "flag16thUp" }, ... ], }, ... }
...
} The structure uses the name of the set as its key, and the values include the code point and name of the alternate glyph, together with the name of the character for which this is an alternate ("alternateFor").
